

var ViewOrderCreate = Vue.extend({
    template: '#view-orderCreate-template',
    props: ['wid', 'openid', 'hotel', 'room', 'order', 'orderCount','router'],
    data: function () {
        return {
            qrcodes: [],
             qrIndex:0,
             hasBeenSubmitted: false,
             hasBeenCanceled: false,
             hasBeenPayed: false
        }
    },

    computed: {
        formCanEdit: function () {
            var result = false;
            if (!this.order || !this.order.status || this.order.status <= 0) {
                result = true;
            }

            return result;
        },

        formCanSubmit: function () {
            var result = false;
            if (this.room.id && this.room.id > 0 && this.order && this.order.status <= 0) {
                result = true;
            }

            return result;
        },
        formCanCancel: function () {
            var result = false;
            if (this.order && this.order.status >= 0 && this.order.status <= 2) {
                result = true;
            }

            return result;
        },
        formCanPay: function () {
            var result = false;
            if (this.order && this.order.status == 1) {
                result = true;
            }

            return result;
        },
        isShowQRCode:function(){
            var result = false;
            if (this.order &&( this.order.status == 3||this.order.status == 6||this.order.status == 7)) {
                result = true;
            }

            return result;
        },
        dateSpan: function () {
            var days = 1;
            if (this.order.arriveTime && this.order.leaveTime) {
                var span = Date.parse(this.order.leaveTime) - Date.parse(this.order.arriveTime);
                days = Math.floor(span / (24 * 3600 * 1000));

            }
            return days;
        },
        totalPrice: function () {
                var result=0
            var re= (this.order.orderNum * this.dateSpan * this.room.totalPrice).toFixed(2);
            if(re)
            {
                result=re;
            }
            return result;
        },

        costPrice: function () {
            var result=0
            var re=(this.order.orderNum * this.dateSpan * this.room.costPrice).toFixed(2);
            if(re)
            {
                result=re;
            }
            return result;

        },
        discount: function () {

            return (this.costPrice - this.totalPrice).toFixed(2);
        },
        today: function () {
            return new Date().toJSON().split('T')[0];
        },
        minLeaveDate: function () {
            var leave = new Date();
            if (this.order.arriveTime) {
                var arrive = new Date(this.order.arriveTime);

                leave = arrive;
            }
            leave.setDate(leave.getDate() + 1);
            return leave.toJSON().split('T')[0];
        },
        idCardRequired: function () {
            var result = false;
            if (this.order.orderUser && this.order.orderUser.userIdcard) {
                if (!this.isIdCard(this.order.orderUser.userIdcard)) {
                    result = true;
                }
            }

            return result;
        },
        userMobileRequired: function () {
            var result = false;
            if (this.order.orderUser && this.order.orderUser.userMobile) {
                if (!this.isMobile(this.order.orderUser.userMobile)) {
                    result = true;
                }
            }

            return result;
        },
        arriveTimeRequired:function(){
            var result = false;
            if (this.order.arriveTime ) {
                var today = new Date((new Date()).setHours(0, 0, 0, 0));
                var dateArrive=new Date(this.order.arriveTime);
                if (dateArrive<today) {
                    result = true;
                }
            }
            return result;
        },
        leaveTimeRequired:function(){
            var result = false;
            if (this.order.leaveTime ) {
                var today = new Date((new Date()).setHours(0, 0, 0, 0));
                var dateleave=new Date(this.order.leaveTime);

                if (dateleave<today) {
                    result = true;
                }

                if(!result&&!this.arriveTimeRequired)
                {
                    var dateArrive=new Date(this.order.arriveTime);
                    if(dateleave<=dateArrive)
                    {
                        result=true;
                    }
                }

            }
            return result;
        },
        canSubmit: function () {
            var result = true;

            if (this.isEmpty(this.order.orderUser.userName)
                || this.isEmpty(this.order.orderUser.userIdcard)
                || this.isEmpty(this.order.orderUser.userMobile)
                || this.isEmpty(this.order.arriveTime)
                || this.isEmpty(this.order.leaveTime)
            ) {
                return false;
            }
            else if (this.userMobileRequired || this.idCardRequired||this.arriveTimeRequired||this.leaveTimeRequired) {
                return false;
            }

            if(result)
            {
                result=!this.hasBeenSubmitted;
            }
            return result;
        },
        currentQrcode: function () {
                return this.qrcodes[this.qrIndex];

        }


    },
    filters: {
        'imgbase64': function (item) {
            var result = '';
            if (item) {
                if(item.status==3||item.status==4)
                {
                    result='data:image/png;base64,';
                }
                else{
                    result = qr.toDataURL({value:item.code,size:8});
                }

            }
            return result;
        },
        'qrcodeStatus': function (item) {
            var result = '';
            if (item) {
                switch(item)
                {
                    case 0:
                    case 1:
                        result='<span style="color:#777">未使用</span>';
                        break;
                    case 2:
                        result='<span style="color:#3c763d">已使用</span>';
                        break;
                    case 3:
                    case 4:
                        result='<span style="color:#a94442">已失效</span>';
                        break;
                }

            }
            return result;
        }
    },
    watch: {
        'order.id': function (val, oldVal) {

            //不同订单，显示不同信息
            if (oldVal != val) {
                this.hasBeenSubmitted=false;
                if (val > 0) {
                    this.getOrdrderData();
                }
                else {
                    this.getNoOrderData();
                }
            }
        }
    },
    activate: function (done) {
        var self = this;
        this.getNoOrderData();

        //this.toggleItemShow();
        done();
    },
    attached: function () {
        console.log('attached');
    },
    ready: function () {
        var self = this;
        this.getOrdrderData();
        this.initItemCollapse();
        this.initSwiper();
        //this.toggleItemShow();


    },
    methods: {
        isIdCard: function (val) {
            return (/(^\d{15}$)|(^\d{17}([0-9]|X)$)/.test(val));
        },
        isMobile: function (val) {
            return (/^((1[3,5,8][0-9])|(14[5,7])|(17[0,6,7,8]))\d{8}$/.test(val));
        },
        isEmpty: function (val) {
            if (!val) {
                return true;
            }
            var str = val.trim();
            return (!str || 0 === str.length);
        },
        activateValidator: function () {
            //if(this.$activateValidator)
            //{
            //    this.$activateValidator();
            //}
        },
        initSwiper: function () {
            var self=this;
            setTimeout(function(){
                self.swiper = new Swiper('#qr_swiper', {
                    pagination: '#qr_swiper .swiper-pagination',

                    nextButton: '#qr_swiper .swiper-button-next',
                    prevButton: '#qr_swiper .swiper-button-prev',

                    spaceBetween: 30,
                    centeredSlides: true,
                    paginationClickable: true,
                    onSlideChangeEnd: function(swiper){
                        self.qrIndex=swiper.activeIndex

                    }

                });
            },100);
        },
        getOrdrderData: function () {
            var self = this;
            var hasOrder = false;

            //如果已有订单，获取订单详情
            if (this.order && this.order.id && this.order.id > 0) {
                hasOrder = true;
                this.getOrder(function (data) {
                    self.order = data;
                    self.formReadonly();

                    //获取房间详情
                    self.room.id = data.roomId;
                    self.getRoom(function (data) {
                        self.room = data;
                        self.viewOrderCreate(self.room);
                        self.$dispatch('onimgDataDispatch', self.room.roomPictures);
                        $.hidePreloader();
                        self.activateValidator();

                    }, function () {
                        self.activateValidator();
                    });

                    //获取验证码
                    self.getQrCode(function (data) {
                            self.qrcodes = data;
                            self.$nextTick(function () {
                                self.swiper.update(true);
                                //self.swiper.slidePrev();
                                //self.swiper.updateSlidesSize();
                                //self.swiper.updatePagination();
                            });

                        },
                        function (response) {
                            $.toast("获取验证码失败!");
                        });

                }, function () {
                    self.activateValidator();
                });
            }
                //如果房间对象存在，则获取详细的房间信息
            else if (this.room && this.room.id) {
                this.getRoom(function (data) {
                    self.room = data;
                    $.hidePreloader();
                    if (!hasOrder) {
                        self.activateValidator();

                    }
                }, function () {
                    self.activateValidator();
                });
            }
            else {
                self.activateValidator();
            }
        },
        // renderQrcode:function(argument) {
        //   for (var i = 0; i < this.qrcodes.length; i++) {
        //     var qrdata= this.qrcodes[i];
        //     qr.canvas({
        //       canvas: document.getElementById('qr_'+i),
        //       value: qrdata.code });
        //   }
        // },
        getNoOrderData: function () {
            var self = this;
            if (!this.order || !this.order.id || this.order.id <= 0) {
                self.order = {
                    id: 0,
                    discount: 0,
                    totalPrice: 0,
                    costPrice: 0,
                    orderNum: 1,
                    status: -1,
                    orderUser: {}
                };

                this.getOrderLastUserInfo(function (data) {
                    self.order.orderUser = data;
                    $.hidePreloader();
                    self.$dispatch('onOrderDispatch', self.order);
                    //self.$activateValidator();
                });
            }
        },
        getRoom: function (callBack, errorCallBack) {
            // GET request
            this.$http.get('api/room/GetRoom',
                { wid: this.wid, openid: this.openid, hotelId: this.hotel.id, roomId: this.room.id }).then(function (response) {
                    if (response.data) {
                        callBack(response.data);
                    }

                }, function (response) {
                    errorCallBack(response);
                    // handle error
                });
        },
        getOrderLastUserInfo: function (callBack) {
            this.$http.get('api/order/GetOrderLastUserInfo',
                { wid: this.wid, openid: this.openid }).then(function (response) {
                    if (response.data) {
                        callBack(response.data.user);
                    }

                }, function (response) {

                    // handle error
                });
        },
        getOrder: function (callBack, errorCallBack) {
            // GET request
            this.$http.get('api/order/GetOrder',
                { wid: this.wid, openid: this.openid, orderId: this.order.id }).then(function (response) {
                    if (response.data) {
                        callBack(response.data.order);

                    }
                    else {
                        $.toast("获取订单失败!");
                    }
                }, function (response) {
                    errorCallBack(response);
                    // handle error
                });
        },
        getQrCode: function (callBack, errorCallBack) {
            this.$http.get('api/order/getQrCode',
                { orderId: this.order.id }).then(function (response) {
                    if (response.data) {
                        callBack(response.data);
                    }
                }, function (response) {
                    errorCallBack(response);
                });
        },
        onSubmit: function () {
            var self = this;

            if (!this.canSubmit) {
                return;
            }
            this.hasBeenSubmitted = true;


            this.$http.post('api/order/Save',
                {
                    wid: this.wid,
                    openid: this.openid,
                    hotelId: this.hotel.id,
                    roomId: this.room.id,
                    roomType: this.room.roomType,
                    order: this.order
                })
                .then(function (response) {
                    self.hasBeenSubmitted = false;
                    if (response.data) {
                        self.orderCount++;
                        self.updateOrderNumber(self.orderCount);
                        $.toast("保存成功!");
                        self.router.setRoute('/order');

                    }
                    else {
                        $.toast("保存失败!");
                    }
                }, function (response) {
                    if (response.data.message) {
                        $.toast(response.data.message);
                    }
                });
        },
        onPay: function () {
            var self = this;

            if (!this.hasBeenPayed) {
                return;
            }
            this.hasBeenPayed = true;
            this.$http.get('api/order/GetPayUrl',
                {
                    wid: this.wid,
                    openid: this.openid,
                    orderId: this.order.id
                })
                .then(function (response) {
                    if (response.data) {
                        document.location.href = response.data;
                    }
                }, function (response) {
                    if (response.data.message) {
                        $.toast(response.data.message);
                    }
                });
        },
        onCancel: function () {
            var self = this;

            if (!this.hasBeenCanceled) {
                return;
            }
            this.hasBeenCanceled = true;
            this.$http.post('api/order/Cancel',
                {
                    
                    orderId: this.order.id
                })
                .then(function (response) {
                    if (response.data) {
                        $.toast("取消成功!");
                        self.router.setRoute('/order');

                    }
                    else {
                        $.toast("取消失败!");
                    }
                }, function (response) {
                    if (response.data.message) {
                        $.toast(response.data.message);
                    }   
                });
        },
        updateOrderNumber: function (num) {
            this.$dispatch('onUpdateOrderNumberDispatch', num);
        },
        viewOrderCreate: function (room, $event) {
            if (room) {
                this.$dispatch('onviewOrderCreateDispatch', room);
            }
        },
        toggleItemShow: function () {
            //显影
            $(".gpd-item-title").click(function () {
                var zThis = $(this);
                var zThisParent = zThis.parents(".detailcontent");
                zThisParent.toggleClass("gdp-curr");
                zThisParent.siblings(".detailcontent").removeClass("gdp-curr");
            });
        },
        initItemCollapse: function () {
            $(".item-content.item-collapse .item-header").click(function () {
                var zThis = $(this).parent();

                zThis.toggleClass("in");
            });
        },
        formReadonly: function () {
            $("form").find('input,select,textarea').prop("readonly", !this.formCanEdit);
        }
    }
});
